import React, { Component } from 'react';
import Card from "./Card";
import "./CardSection.css";

class CardSection extends Component {
  constructor(props) {
    super(props);
    this.state = {  };
  }
  render() {
    return (
      <div className="cardSection">
      <Card
        projectName="Cash on Delivery"
        intro="One of Wish's SEA Initiative projects, increased GMV and unique buyer conversion rate in SEA."
      />

      <Card
        projectName="Wish Local Pickup"
        intro="Intro"
      />

      <Card
        projectName="Project 2"
        intro="Intro"
      />
    </div>
    );
  }
}

export default CardSection;
